import React from 'react';
import './css/Home.css';

function Home() {
  const handleStart = async () => {
    try {
      const response = await fetch('https://ia-sport.oa.r.appspot.com/api/start-recording', {
        method: 'PUT',
		mode: 'no-cors'
      });

      if (!response.ok) {
        throw new Error('Failed to start recordinggg');
      }

      alert('Recording started successfully');
    } catch (error) {
      console.error('Error:', error);
      alert('Failed to start recordingg');
    }
  };

  return (
    <div>
      <h2>Home Page</h2>
      <p>Welcome to the Home Page!</p>

      <div className="button-container">
        <button className="btn-start" onClick={handleStart}>Start</button>
        <button className="btn-stop">Stop</button>
      </div>
    </div>
  );
}

export default Home;
